Description
Patrizia B.,Marta,Eva,Monia Regia

: La splendida Patrizia B., il Trans preferito dal rampollo della famosa famiglia torinese delle automobili, torna alla grande mostrandosi piu scabrosa e scandalosa che mai... Potrete ammirare oltre alla dolcissima Pat anche altre 4 splendide scene che vedono protagonisti altrettanti bellissimi e superdotati transessuali... 2 ore splendide e depravate da vivere insieme.

